import { Fragment, lazy, Suspense } from "react";
import { Route, Switch } from "react-router-dom";
import LoadingScreen from "./Components/LoadingScreen";
import { AuthGuard, GuestGuard } from "./Guards";
import "react-toastify/dist/ReactToastify.css";
import { ToastContainer, toast } from "react-toastify";
import React from "react";
import Admin from "./Components/layouts/Admin";
import Auth from "./Components/layouts/Auth";

export const renderRoutes: any = (routes: any = []) => {
  return (
    <>
      <Suspense fallback={<LoadingScreen />}>
        <Switch>
          {routes.map((route: any, i) => {
            const Guard: any = route.guard || Fragment;
            const Component: any = route.component;
            const Layout: any = route.layout || Fragment;

            return (
              <Route
                key={i}
                path={route.path}
                exact={route.exact}
                render={(props) => {
                  return (
                    <Guard>
                      <Layout>
                        {route.routes ? (
                          renderRoutes(route.routes)
                        ) : (
                          <Component {...props} />
                        )}
                      </Layout>
                    </Guard>
                  );
                }}
              />
            );
          })}
        </Switch>
      </Suspense>
      <ToastContainer />
    </>
  );
};

export const routes = [
  {
    exact: true,
    path: "/login",
    // layout: Auth,
    component: lazy(() => import("./Components/views/auth/Login")),
  },
  {
    exact: true,
    path: "/register",
    component: lazy(() => import("./Components/views/auth/Signup")),
  },
  {
    exact: true,
    path: "/forgot-password",
    component: lazy(() => import("./Components/views/auth/ForgotPassword")),
  },
  {
    exact: true,
    path: "/passwordreset/:code",
    component: lazy(() => import("./Components/views/auth/ResetCode")),
  },
  {
    exact: true,
    path: "/verifyemail/:code",
    component: lazy(() => import("./Components/views/auth/Verify")),
  },
  {
    exact: true,
    path: "/staffonboarding",
    component: lazy(() => import("./Components/views/Onboarding/Staff_onboarding")),
    guard: AuthGuard,
  },
  {
    path: "/admin",
    layout: Admin,
    guard: AuthGuard,
    routes: [
      {
        exact: true,
        path: "/admin/dashboard",
        component: lazy(
          () =>
            import("./Components/views/Dashboard/AdminDashboard/AdminDashboard")
        ),
      },
      {
        exact: true,
        path: "/admin/staffs/:id/:type",
        component: lazy(
          () =>
            import("./Components/views/Dashboard/AdminDashboard/Admin_Staffs")
        ),
      },
      {
        exact: true,
        path: "/admin/:organisation_id/staffs/add/:client_id",
        component: lazy(
          () =>
            import("./Components/views/Dashboard/AdminDashboard/Admin_Add_User")
        ),
      },
      {
        exact: true,
        path: "/admin/client/hospitals",
        component: lazy(
          () =>
            import("./Components/views/Dashboard/AdminDashboard/Admin_Hospitals")
        ),
      },
      {
        exact: true,
        path: "/admin/client/pharmacy",
        component: lazy(
          () =>
            import("./Components/views/Dashboard/AdminDashboard/Admin_Pharmacy")
        ),
      },
      {
        exact: true,
        path: "/admin/client/other",
        component: lazy(
          () =>
            import("./Components/views/Dashboard/AdminDashboard/Admin_Client_Others")
        ),
      },
      {
        exact: true,
        path: "/admin/client",
        component: lazy(
          () =>
            import("./Components/views/Dashboard/AdminDashboard/Admin_Clients")
        ),
      },
      {
        exact: true,
        path: "/admin/client/add",
        component: lazy(
          () =>
            import("./Components/views/Dashboard/AdminDashboard/Admin_Add_Client")
        ),
      },
      {
        exact: true,
        path: "/admin/organisation",
        component: lazy(
          () =>
            import("./Components/views/Dashboard/AdminDashboard/All_Organizations")
        ),
      },
      {
        exact: true,
        path: "/admin/organisation/add",
        component: lazy(
          () =>
            import("./Components/views/Dashboard/AdminDashboard/Admin_Add_Organizations")
        ),
      },
    ],
  },
];

